function App(){


    let greeting='';
   // let curdet=new Date();
   // curdet=curdet.getHours();
   let curdet = 7;
   const css={};
    if( curdet >=  12  &&  curdet <= 19 ){
      css.color='orange';
      css.weight='bold';
 
     greeting='GOOD AFTER NOON';
    }else if( curdet  >= 7 &&  curdet <= 12  ){
        greeting='GOOD MORNING';
        css.color='green';
    }else{
        greeting='GOOD NIGHT';
        css.color='black';
    }
   return( 
       <>
       <div>
    <h1> hello sir,
        <span style={css}>
           {greeting}
           </span>
    </h1>
       </div>
       </>);


}
export default App;
